const API_URL = "https://api.themoviedb.org/3"
const API_KEY = "?api_key=c6b78e19f7ba833c205511b80032a27c"


function getTrendMoviesPicsOnly20(page){
    return fetch( `${API_URL}/trending/movie/day${API_KEY}?page=${page}`  )
        .then(async response => await response.json())
        .then(data => {return data})
}

export default function getTrendMoviesPics(){
    return getTrendMoviesPicsOnly20(2)

}
